<script>
    let P1 = {
        postAjax: function (url, data, callback) {
            $.ajax({
                url: url,
                method: 'POST',
                data: data,
                success: function (res) {
                    if (callback) {
                        callback(res);
                    }
                }
            });
        }
    }
    $(function(){
        $("#form-buy-now").submit(function (e) {
            let name = $("#form-name").val();
            let phone = $("#form-phone").val();
            let address = $("#form-address").val();
            let quantity = $("#form-quantity").val();
            let _token = '{{csrf_token()}}'

            P1.postAjax('{{ route('p1_add_customer') }}', {_token, name, phone, address, quantity}, function (response) {
                console.log(response)
                window.location = `{{ route('frontend.p1.thanks') }}`
            });

            return false
        })
    })
</script>

